//This function draws the start screen which includes the game title, menu options, creator's names and the starting values for the game. Also draws in the bricks at the bottom of the screen.
.globl startScreen
startScreen:
        push    {lr}

        bl      drawStartScreen       //Draws the intro screen.
        b       brickCond

//Draws a brick square of size 64x64 onto the screen and the X position is incremented by 64 after.
brickBody:
        ldr     r9, =brickArea        //Draw the blue square.
        ldr     r0, [r9]
        ldr     r1, [r9, #4]
        ldr     r2, [r9, #8]
        ldr     r3, [r9, #12]
        bl      drawBrick

        ldr     r9, =brickArea        //Increment the brickArea label by 64 (X coordinates).
        ldr     r8, [r9]
        add     r8, #64
        str     r8, [r9]
        ldr     r8, [r9, #8]
        add     r8, #64
        str     r8, [r9, #8]

        ldr     r9, =brickCounter     //Increment the brickCounter.
        ldr     r8, [r9]
        add     r8, #1
        str     r8, [r9]

//Loops until a line of brick squares are draw at the bottom of the screen.
brickCond:
        ldr     r9, =brickCounter     //Loops back to brickBody if the brickCounter is less than 16.
        ldr     r8, [r9]
        cmp     r8, #16
        blt     brickBody

        ldr     r9, =brickCounter     //Resets brickCounter back to its initial value.
        mov     r8, #0
        str     r8, [r9]

        ldr     r9, =brickArea        //Resets brickArea back to its initial values.
        mov     r8, #0
        str     r8, [r9]
        mov     r8, #704
        str     r8, [r9, #4]
        mov     r8, #64
        str     r8, [r9, #8]
        mov     r8, #768
        str     r8, [r9, #12]

        pop     {lr}
        bx 	    lr			              //Return back to calling code

//This function draws the brick image at the bottom of the screen, where Mario walks on.
.globl drawBrick
drawBrick:
        push    {lr}
        mov	r4,	r0			//Start X position of your picture
        mov     r9,     r0
	mov	r5,	r1
	ldr	r6,	=brick			//Address of the picture
	mov	r7,	r2			//Width of your picture
	mov	r8,	r3			//Height of your picture

        b       drawPictureLoop

//This function draws the starting screen, that contains: the game title, menu options, creator's names and the starting values for the game.
drawStartScreen:
        push    {lr}
	mov	r4,	#0			//Start X position of your picture
        mov     r9,     #0
	mov	r5,	#0
	ldr	r6,	=start			//Address of the picture
	mov	r7,	#1024			//Width of your picture
	mov	r8,	#704			//Height of your picture

        b       drawPictureLoop

//This function clears the screen, by drawing a black line and looping until the entire screen is cleared with black.
//This function takes in 4 parameters:
//r0 is the starting X position of clear screen position.
//r1 is the starting Y position of clear screen position.
//r2 is the end X position of clear screen position.
//r3 is the end Y position of clear screen position.
.globl clearScreen
clearScreen:
        push    {r0-r3, lr}
        mov	r4,	r0			//x value
        mov     r9, r4
	mov	r5,	r1			//Y value
	mov	r6,	#0			//black color
	mov	r7,	r2			//Width of screen
	mov	r8,	r3			//Height of the screen

//Loops to increments the X and Y position in order to draw a multiple black lines to clear the screen.
Looping:
	mov	r0,	r4			//Setting x
	mov	r1,	r5			//Setting y
	mov	r2,	r6			//setting pixel color
	push    {lr}
	bl	DrawPixel
	pop     {lr}
	add	r4,	#1			//increment x by 1
	cmp	r4,	r7			//compare with width
	blt	Looping
	mov	r4,	r9			//reset x
	add	r5,	#1			//increment Y by 1
	cmp	r5,	r8			//compare with height
	blt	Looping

        pop     {r0-r3, lr}
	bx      lr			        //return

//This function draws out the ascii image pixel by pixel onto the screen.
drawPictureLoop:
	mov	r0,	r4			//passing x for ro which is used by the Draw pixel function
	mov	r1,	r5			//passing y for r1 which is used by the Draw pixel formula

	ldrh	r2,	[r6],#2			//setting pixel color by loading it from the data section. We load hald word
	bl	DrawPixel
	add	r4,	#1			//increment x position
	cmp	r4,	r7			//compare with image with
	blt	drawPictureLoop
	mov	r4,	r9			//reset x
	add	r5,	#1			//increment Y
	cmp	r5,	r8			//compare y with image height
	blt	drawPictureLoop
	pop     {lr}
	bx 	lr			//return

//This fuction draws out the specific pixel corresponding to the current position the drawPictureLoop is at.
.globl DrawPixel
DrawPixel:
	push	{r4}

	offset	.req	r4

	// offset = (y * 1024) + x = x + (y << 10)
	add		offset,	r0, r1, lsl #10
	// offset *= 2 (for 16 bits per pixel = 2 bytes per pixel)
	lsl		offset, #1

	// store the colour (half word) at framebuffer pointer + offset

	ldr	r0, =FrameBufferPointer
	ldr	r0, [r0]
	strh	r2, [r0, offset]

	pop		{r4}
	bx		lr

//Data section
.section .data

//The label that keeps track of the number of brick squares needed in a line to fit the screen.
brickCounter:
        .int    0

//The label that has the starting coordinates for the brick square to be drawn on screen.
brickArea:
        .int    0, 704, 64, 768

